"use client";

import { ArrowIcon } from "components/icons";
import Link from "next/link";
import contact from "./contact.json";

function createContactVcf() {
  const contactData = [
    `BEGIN:VCARD`,
    `VERSION:3.0`,
    `N:${contact.lastName};${contact.firstName};;;`,
    `FN:${contact.firstName} ${contact.lastName}`,
    `ORG:${contact.work.company}`,
    `TITLE:${contact.work.role}`,
    `TEL;TYPE=WORK,CELL:${contact.phone}`,
    `EMAIL:${contact.email}`,
    `ADR;TYPE=WORK:;;${contact.address.street};${contact.address.zip} ${contact.address.city};;;${contact.address.country}`,
    `BDAY:--${contact.birthdate.substring(5).replace("-", "")}`,
    `BDAY;X-APPLE-OMIT-YEAR=1604:1604-${contact.birthdate.substring(5)}`,
    `URL:${contact.website}`,
    `PHOTO;TYPE=PNG;ENCODING=B:`,
    `NOTE:You met ${contact.firstName} on ${new Date().toLocaleDateString(
      "en-US",
      {
        month: "long",
        day: "numeric",
        year: "numeric",
      }
    )}.`,
    `END:VCARD`,
  ].join("\n");

  return new Blob([contactData], { type: "text/vcard" });
}

function downloadContactVcf() {
  const file = createContactVcf();
  const url = URL.createObjectURL(file);

  const a = document.createElement("a");
  a.style.display = "none";
  a.download = `${contact.firstName} ${contact.lastName}.vcf`;
  a.href = url;
  console.log(url);
  document.body.appendChild(a);
  a.click();

  setTimeout(() => {
    document.body.removeChild(a);
    URL.revokeObjectURL(url);
  }, 0);
}

export function ContactSaveButton() {
  return (
    <Link
      className="flex items-center hover:text-neutral-700 dark:hover:text-neutral-200 transition-all text-neutral-500 dark:text-neutral-400 mt-2"
      href="/card"
      scroll={false}
      onClick={downloadContactVcf}
    >
      <ArrowIcon />
      <p className="h-7">Save in Contacts</p>
    </Link>
  );
}
